class Solution(object):
    def productExceptSelf(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """

        result = 1
        zeroCounter = 0

        for idx, x in enumerate(nums):
            if(x == 0):
                zeroCounter += 1
                if(zeroCounter) > 1:
                    return [0] * len(nums)
                continue
            result = result * x



        for idx, y in enumerate(nums):
            if 0 in nums:
                if nums[idx] == 0:
                    nums[idx] = result
                    continue
                elif nums[idx]!= 0:
                    nums[idx] = 0
                    continue
            nums[idx] = result//nums[idx]
        return nums
            
            
